(49, 'Infrastruktur', 'Kementerian Desa, Pembangunan Daerah Tertinggal, dan Transmigrasi', 'TERDAMPAK GEMPA DI KEBONÂ JERUK', 'Bangilan', 'balgis', 'balgis@gmail.com', 'Pada hari Minggu, 9 Juni 2024, sekitar pukul 04:00 WIB, telah terjadi gempa bumi berkekuatan 6,5 SR yang berpusat di sekitar Jakarta Barat. Guncangan gempa yang kuat dirasakan di wilayah Kelurahan Kebon Jeruk, menyebabkan kerusakan pada beberapa bangunan, termasuk rumah saya. Dinding rumah retak, plafon runtuh, dan beberapa perabotan hancur. Kondisi ini sangat mengkhawatirkan dan membuat kami sekeluarga terpaksa mengungsi ke tempat yang lebih aman. Saya sangat memohon bantuan dari BPBD untuk segera melakukan penilaian kerusakan, memberikan bantuan darurat, dan membantu evakuasi kami ke tempat penampungan yang lebih aman. Kami juga membutuhkan bantuan medis dan logistik segera mengingat situasi yang mendesak ini. Terima kasih atas perhatian dan bantuannya.', '2024-06-09 12:16:15', '', '');
INSERT INTO `pengaduan` (`id_pengaduan`, `kategori_pengaduan`, `instansi`, `judul_pengaduan`, `wilayah`, `nama`, `email`, `pesan`, `tanggal`, `gambar`, `video`) VALUES
(51, 'Perusakan Lingkungan', 'Kementerian Dalam Negeri', 'POHON TUMBANG', 'Bangilan', 'cintha', 'cintha@gmail.com', 'Pada hari Sabtu, 8 Juni 2024, sekitar pukul 14:30 WIB, saya menyaksikan sebuah pohon besar tumbang di dekat Jalan Raya Merdeka, Kelurahan Kebon Jeruk, Jakarta Barat, akibat hujan deras dan angin kencang. Pohon tersebut menutupi sebagian besar jalan, menyebabkan kemacetan lalu lintas yang cukup parah. Sebuah mobil pribadi yang sedang melintas juga tertimpa pohon tersebut, mengakibatkan kerusakan berat pada bagian atap dan kaca depan, namun beruntung tidak ada korban jiwa. Saya segera melaporkan kejadian ini kepada pihak berwenang, dan tidak lama kemudian tim Dinas Pertamanan dan Hutan Kota serta petugas Pemadam Kebakaran tiba di lokasi untuk melakukan evakuasi dan pembersihan pohon tumbang.\r\n', '2024-06-09 12:19:48', '', '');
INSERT INTO `pengaduan` (`id_pengaduan`, `kategori_pengaduan`, `instansi`, `judul_pengaduan`, `wilayah`, `nama`, `email`, `pesan`, `tanggal`, `gambar`, `video`) VALUES
(52, 'Perusakan Lingkungan', 'Kementerian Dalam Negeri', 'BANJIR SAMPAI SETENGAH BADAN', 'Bangilan', 'Firda', 'firda@gmail.com', 'mulai sekitar pukul 03:00 WIB, wilayah Kelurahan Kebon Jeruk mengalami hujan deras yang berlangsung hingga saat ini. Akibat curah hujan yang tinggi, Jalan Raya Merdeka dan beberapa area sekitarnya mengalami banjir dengan ketinggian air mencapai 50-70 cm. Banjir ini mengakibatkan kendaraan tidak dapat melintas, beberapa rumah warga tergenang air, dan aktivitas wargaÂ terganggu.', '2024-06-09 12:20:47', '', '');
INSERT INTO `pengaduan` (`id_pengaduan`, `kategori_pengaduan`, `instansi`, `judul_pengaduan`, `wilayah`, `nama`, `email`, `pesan`, `tanggal`, `gambar`, `video`) VALUES
(53, 'Pelayanan Publik', 'Kementerian Kesehatan', 'KETIDAKTERATURAN ANTRIAN', 'Bangilan', 'balgis', 'balgis@gmail.com', 'Saya memohon agar pihak BPJS Kesehatan dapat memperbaiki sistem antrian dengan menyediakan lebih banyak petugas dan memberikan nomor antrian yang lebih teratur. Selain itu, diperlukan peningkatan kompetensi petugas dalam memberikan informasi yang konsisten dan jelas kepada peserta. Saya juga berharap agar sistem komputer dapat diperbaiki untuk memastikan proses pendaftaran berjalan lancar tanpa hambatan teknis.', '2024-06-09 13:16:05', '', '');

